//给你一个字符串 s 和两个整数 x 和 y 。你可以执行下面两种操作任意次。 
//
// 
// 删除子字符串 "ab" 并得到 x 分。
//
// 
// 比方说，从 "cabxbae" 删除 ab ，得到 "cxbae" 。 
// 
// 
// 删除子字符串"ba" 并得到 y 分。
// 
// 比方说，从 "cabxbae" 删除 ba ，得到 "cabxe" 。 
// 
// 
// 
//
// 请返回对 s 字符串执行上面操作若干次能得到的最大得分。 
//
// 
//
// 示例 1： 
//
// 输入：s = "cdbcbbaaabab", x = 4, y = 5
//输出：19
//解释：
//- 删除 "cdbcbbaaabab" 中加粗的 "ba" ，得到 s = "cdbcbbaaab" ，加 5 分。
//- 删除 "cdbcbbaaab" 中加粗的 "ab" ，得到 s = "cdbcbbaa" ，加 4 分。
//- 删除 "cdbcbbaa" 中加粗的 "ba" ，得到 s = "cdbcba" ，加 5 分。
//- 删除 "cdbcba" 中加粗的 "ba" ，得到 s = "cdbc" ，加 5 分。
//总得分为 5 + 4 + 5 + 5 = 19 。 
//
// 示例 2： 
//
// 输入：s = "aabbaaxybbaabb", x = 5, y = 4
//输出：20
// 
//
// 
//
// 提示： 
//
// 
// 1 <= s.length <= 105 
// 1 <= x, y <= 104 
// s 只包含小写英文字母。 
// 
// Related Topics 贪心算法

package com.cute.leetcode.editor.cn;

public class MaximumScoreFromRemovingSubstrings {
    public static void main(String[] args) {
        Solution solution = new MaximumScoreFromRemovingSubstrings().new Solution();
        solution.maximumGain("",
                805,
                3039);
    }


    //leetcode submit region begin(Prohibit modification and deletion)
    class Solution {
        public int scoreAdd(StringBuilder sb, int score, String deleteStr, int sc) {
            boolean flag = true;
            while (flag) {
                int deleteIndex = sb.indexOf(deleteStr);
                if (deleteIndex >= 0) {
                    sb.delete(deleteIndex, deleteIndex + 2);
                    score += sc;
                } else {
                    flag = false;
                }
            }
            return score;
        }

        public int maximumGain(String s, int x, int y) {
            long start = System.currentTimeMillis();
            StringBuilder sb = new StringBuilder(s);
            int score = 0;
            String ab = "ab";
            String ba = "ba";
            if (x > y) {
                score = scoreAdd(sb, score, ab, x);
                score = scoreAdd(sb, score, ba, y);
            } else {
                score = scoreAdd(sb, score, ba, y);
                score = scoreAdd(sb, score, ab, x);
            }
            System.out.println("所用时间：" + (System.currentTimeMillis() - start));
            return score;
        }
    }
//leetcode submit region end(Prohibit modification and deletion)

}